import React from 'react';
// import './ToolTip.css';

function ToolTip(props) {
  const gifUrl = props.details.gif;

  console.log(gifUrl)

  return (
    <div
        style={{
            position: 'absolute',
            top: 0,
            left: 0
        }}
        className="Overlay"
    >
      <img src={`${gifUrl}`}/>
    </div>
  );
}

export default ToolTip;
